public void init()
{
    super();

    qbds_rentalOrderLineView = RORRentalOrderLineView_ds.query().dataSourceTable(tableNum(RORRentalOrderLineView));

    xSysLastValue::getLast(this);

    if (subStatusFiterValue)
    {
        SubStatusFilter.text(subStatusFiterValue);
        element.addSubStatusFilerRange();
    }

    this.populateLookups();
}

public container pack()
{
    return [#CurrentVersion,#CurrentList];
}

public boolean unpack(container _packedClass)
{
    int version     = RunBase::getVersion(_packedClass);
    boolean result;

    switch (version)
    {
        case #CurrentVersion:
            [version,#CurrentList] = _packedClass;
            result = true;
            break;
        default :
            result = false;
            break;
    }

    return result;
}

