public void addSubStatusFilerRange()
{
    container subStatusesCon = str2con(subStatusFiterValue, ';');

    int containerLen = conLen(subStatusesCon);

    if (containerLen > 0)
    {
        SysDictEnum dictEnum = new SysDictEnum(enumNum(BOBRentalSubStatus));
        QueryBuildRange queryFilterRange = SysQuery::findOrCreateRange(qbds_rentalOrderLineView, fieldNum(RORRentalOrderLineView, BOBRentalSubStatus));
        str strValue = '((';

        int counter = 1;
        while (counter <= containerLen)
        {
            str subStatus = conPeek(subStatusesCon, counter);

            if (subStatus == "")
            {
                qbds_rentalOrderLineView.clearRange(fieldNum(RORRentalOrderLineView, BOBRentalSubStatus));
                return;
            }
            else
            {

                strValue += strFmt('%1 == %2', fieldStr(RORRentalOrderLineView, BOBRentalSubStatus), queryValue(dictEnum.symbol2Value(subStatus)));

                if (counter != containerLen)
                {
                    strValue += ') || (';
                }
            }

            counter++;
        }

        strValue += '))';

        queryFilterRange.value(strValue);
    }
    else
    {
        qbds_rentalOrderLineView.clearRange(fieldNum(RORRentalOrderLineView, BOBRentalSubStatus));
    }
}

