public boolean modified()
{
    boolean ret = super();

    if (ret)
    {
        ItemIdSmall itemId = ItemIdFilter.text();

        if (itemId)
        {
            QueryBuildRange queryFilterRange = SysQuery::findOrCreateRange(qbds_rentalOrderLineView, fieldNum(RORRentalOrderLineView, ItemId));
            queryFilterRange.value(queryValue(itemId));
        }
        else
        {
            qbds_rentalOrderLineView.clearRange(fieldNum(RORRentalOrderLineView, ItemId));
        }

        RORRentalOrderLineView_ds.executeQuery();
    }

    return ret;
}

